create table taxonadjudicated
(
    adjudicatedid       integer      not null
        constraint taxonadjudicated_pkey
            primary key,
    nameadjudicated     varchar(120) not null,
    authadjudicatedid   integer      not null
        constraint taxonadjudicated_authadjudicatedid_fkey
            references author,
    statusadjudicatedid smallint     not null
        constraint taxonadjudicated_statusadjudicatedid_fkey
            references taxonstatus,
    acceptedid          integer      not null
        constraint taxonadjudicated_acceptedid_fkey
            references taxonaccepted
);

alter table taxonadjudicated
    owner to postgres;

